window.bookSummaryJSON = "<p>Sometimes it's the wanderers that blaze a path through the darkest night. </p> <p>Aaron Jace had a normal life until they came for him. Now he's being hunted. Assassins will stop at nothing to find him. Aaron is from Earth; his family is not. He is the last scion of an ancient and powerful family. Thrust into another world, Aaron must find his way to the one man who can help him survive. </p> <p><i>The Safanarion Order</i> includes the first three stories in the captivating epic fantasy series listeners describe as compelling and full of suspense. This refreshing blend of magic and technology is sure to satisfy listeners of Anne McCaffrey, Terry Brooks, or Robert Jordan. Start your journey now. </p>"; 
